function getCookie(name) {
    var match = document.cookie.match(new RegExp("(^| )" + name + "=([^;]+)"));
    return match ? match[2] : null;
}

function getParamFromURL(param) {
    var params = new URLSearchParams(window.location.search);
    return params.has(param) ? params.get(param) : null;
}

function initializeIndexedDB() {
    return new Promise((resolve, reject) => {
        let request = indexedDB.open("TrackingDB", 2); // Increment version to trigger onupgradeneeded
        
        request.onupgradeneeded = function(event) {
            let db = event.target.result;
            
            // Check if the object store exists and create it if it doesn't
            if (!db.objectStoreNames.contains("TrackingStore")) {
                db.createObjectStore("TrackingStore", { keyPath: "id" });
                console.log("‚úÖ Object store 'TrackingStore' created");
            }
        };
        
        request.onsuccess = function(event) {
            console.log("‚úÖ IndexedDB initialized successfully");
            let db = event.target.result;
            resolve(db);
        };
        
        request.onerror = function(event) {
            console.error("‚ùå Error initializing IndexedDB:", event.target.error);
            reject(event.target.error);
        };
    });
}

function saveToIndexedDB(newData) {
    return initializeIndexedDB()
        .then(db => {
            return new Promise((resolve, reject) => {
                try {
                    let tx = db.transaction("TrackingStore", "readwrite");
                    let store = tx.objectStore("TrackingStore");
                    let getRequest = store.get(1);
                    
                    getRequest.onsuccess = function(event) {
                        let existingData = event.target.result || {};
                        
                        let mergedData = {
                            id: 1,
                            firstVisitDate: existingData.firstVisitDate || new Date().toISOString(),
                            osDetectedDate: existingData.osDetectedDate || (newData.osId ? new Date().toISOString() : null),
                            osId: newData.osId || existingData.osId,
                            userName: newData.userName || existingData.userName,
                            referrer: newData.referrer || existingData.referrer,
                            // Only update these fields if new values are explicitly provided (not null/undefined)
                            trafficSource: newData.trafficSource !== undefined && newData.trafficSource !== null 
                                ? newData.trafficSource 
                                : existingData.trafficSource,
                            trafficMedium: newData.trafficMedium !== undefined && newData.trafficMedium !== null 
                                ? newData.trafficMedium 
                                : existingData.trafficMedium,
                            trafficName: newData.trafficName !== undefined && newData.trafficName !== null 
                                ? newData.trafficName 
                                : existingData.trafficName,
                            gaId: newData.gaId || existingData.gaId,
                            pageUrl: newData.pageUrl,
                            pagePath: newData.pagePath,
                            lastUpdated: new Date().toISOString()
                        };
                        
                        let putRequest = store.put(mergedData);
                        
                        putRequest.onsuccess = function() {
                            console.log("‚úÖ Data saved to IndexedDB", mergedData);
                            resolve(mergedData);
                        };
                        
                        putRequest.onerror = function(event) {
                            console.error("‚ùå Error saving to IndexedDB:", event.target.error);
                            reject(event.target.error);
                        };
                    };
                    
                    getRequest.onerror = function(event) {
                        console.error("‚ùå Error reading from IndexedDB:", event.target.error);
                        reject(event.target.error);
                    };
                    
                    tx.oncomplete = function() {
                        db.close();
                    };
                    
                    tx.onerror = function(event) {
                        console.error("‚ùå Transaction error:", event.target.error);
                        reject(event.target.error);
                    };
                } catch (error) {
                    console.error("‚ùå Exception in saveToIndexedDB:", error);
                    reject(error);
                }
            });
        })
        .catch(error => {
            console.error("‚ùå Failed to save data:", error);
            // Try to recover by deleting and recreating the database
            return deleteDatabase().then(() => {
                console.log("üîÑ Database deleted, attempting to reinitialize...");
                return initializeIndexedDB().then(() => {
                    console.log("üîÑ Retrying save operation...");
                    return saveToIndexedDB(newData);
                });
            });
        });
}

function retrieveFromIndexedDB() {
    return initializeIndexedDB()
        .then(db => {
            return new Promise((resolve, reject) => {
                try {
                    let tx = db.transaction("TrackingStore", "readonly");
                    let store = tx.objectStore("TrackingStore");
                    let getRequest = store.get(1);
                    
                    getRequest.onsuccess = function(event) {
                        let data = event.target.result || {};
                        console.log("üîç Retrieved from IndexedDB:", data);
                        resolve(data);
                    };
                    
                    getRequest.onerror = function(event) {
                        console.error("‚ùå Error retrieving from IndexedDB:", event.target.error);
                        reject(event.target.error);
                    };
                    
                    tx.oncomplete = function() {
                        db.close();
                    };
                } catch (error) {
                    console.error("‚ùå Exception in retrieveFromIndexedDB:", error);
                    reject(error);
                }
            });
        })
        .catch(error => {
            console.error("‚ùå Failed to retrieve data:", error);
            return {};
        });
}

function deleteDatabase() {
    return new Promise((resolve, reject) => {
        let deleteRequest = indexedDB.deleteDatabase("TrackingDB");
        
        deleteRequest.onsuccess = function() {
            console.log("‚úÖ Database deleted successfully");
            resolve();
        };
        
        deleteRequest.onerror = function(event) {
            console.error("‚ùå Error deleting database:", event.target.error);
            reject(event.target.error);
        };
    });
}

// Handle browser compatibility issues
function isIndexedDBSupported() {
    return !!window.indexedDB;
}

// Initialize tracking
function initializeTracking() {
    if (!isIndexedDBSupported()) {
        console.warn("‚ö†Ô∏è IndexedDB is not supported in this browser");
        return;
    }
    
    retrieveFromIndexedDB()
        .then(existingData => {
            var osPrimary = "{{os}}";
            var osFallback = getParamFromURL("os");
            var osId = osPrimary && osPrimary !== "{{os}}" ? osPrimary : osFallback;

            var userPrimary = "{{user}}";
            var userFallback = getParamFromURL("user");
            var userName = userPrimary && userPrimary !== "{{user}}" ? userPrimary : userFallback;

            // Only include UTM parameters if they are actually present in the URL
            var data = {
                pageUrl: window.location.href,
                pagePath: window.location.pathname,
                osId: osId || existingData.osId,
                userName: userName || existingData.userName,
                referrer: getParamFromURL("referrer")?.trim() || existingData.referrer || document.referrer || null,
                gaId: getCookie("_ga") || existingData.gaId
            };
            
            // Only add UTM parameters to the data object if they exist in the URL
            var utmSource = getParamFromURL("utm_source");
            var utmMedium = getParamFromURL("utm_medium");
            var utmCampaign = getParamFromURL("utm_campaign");
            
            if (utmSource !== null) {
                data.trafficSource = utmSource;
            }
            
            if (utmMedium !== null) {
                data.trafficMedium = utmMedium;
            }
            
            if (utmCampaign !== null) {
                data.trafficName = utmCampaign;
            }

            return saveToIndexedDB(data);
        })
        .then(data => {
            console.log("‚úÖ Tracking initialized with data:", data);
        })
        .catch(error => {
            console.error("‚ùå Failed to initialize tracking:", error);
        });
}

// Start tracking with a slight delay to ensure DOM is fully loaded
document.addEventListener("DOMContentLoaded", function() {
    setTimeout(initializeTracking, 1000);
});

// Also run immediately in case the DOMContentLoaded event has already fired
if (document.readyState === "complete" || document.readyState === "interactive") {
    setTimeout(initializeTracking, 1000);
}

(function() {
  var DB_NAME = "TrackingDB";
  var STORE_NAME = "TrackingStore";
  var DB_VERSION = 2; // Match the version from the previous script

  function initializeIndexedDB() {
    return new Promise((resolve, reject) => {
      let request = indexedDB.open(DB_NAME, DB_VERSION);
      
      request.onupgradeneeded = function(event) {
        let db = event.target.result;
        
        if (!db.objectStoreNames.contains(STORE_NAME)) {
          db.createObjectStore(STORE_NAME, { keyPath: "id" });
          console.log("‚úÖ Object store '" + STORE_NAME + "' created");
        }
      };
      
      request.onsuccess = function(event) {
        console.log("‚úÖ IndexedDB initialized successfully");
        let db = event.target.result;
        resolve(db);
      };
      
      request.onerror = function(event) {
        console.error("‚ùå Error initializing IndexedDB:", event.target.error);
        reject(event.target.error);
      };
    });
  }

  function getIndexedDBData() {
    return initializeIndexedDB()
      .then(db => {
        return new Promise((resolve, reject) => {
          try {
            let tx = db.transaction(STORE_NAME, "readonly");
            let store = tx.objectStore(STORE_NAME);
            let getRequest = store.get(1);
            
            getRequest.onsuccess = function(event) {
              let storedData = event.target.result;
              console.log("üîç Retrieved stored data:", storedData);
              resolve(storedData || {});
            };
            
            getRequest.onerror = function(event) {
              console.error("‚ùå Error retrieving data:", event.target.error);
              reject(event.target.error);
            };
            
            tx.oncomplete = function() {
              db.close();
            };
          } catch (error) {
            console.error("‚ùå Exception in getIndexedDBData:", error);
            reject(error);
          }
        });
      })
      .catch(error => {
        console.error("‚ùå Failed to get data from IndexedDB:", error);
        return {};
      });
  }

  function saveToIndexedDB(data) {
    return initializeIndexedDB()
      .then(db => {
        return new Promise((resolve, reject) => {
          try {
            let tx = db.transaction(STORE_NAME, "readwrite");
            let store = tx.objectStore(STORE_NAME);
            
            // Ensure the data has an ID and is merged correctly
            let dataToSave = Object.assign({}, data, { 
              id: 1,
              lastUpdated: new Date().toISOString()
            });
            
            let putRequest = store.put(dataToSave);
            
            putRequest.onsuccess = function() {
              console.log("‚úÖ Data saved to IndexedDB:", dataToSave);
              resolve(dataToSave);
            };
            
            putRequest.onerror = function(event) {
              console.error("‚ùå Error saving data:", event.target.error);
              reject(event.target.error);
            };
            
            tx.oncomplete = function() {
              db.close();
            };
          } catch (error) {
            console.error("‚ùå Exception in saveToIndexedDB:", error);
            reject(error);
          }
        });
      })
      .catch(error => {
        console.error("‚ùå Failed to save data to IndexedDB:", error);
        throw error;
      });
  }

  function collectNewData() {
    return {
      pageUrl: window.location.href,
      pagePath: window.location.pathname,
      osId: getQueryParam("os") || null,
      userName: getQueryParam("user") || null,
      referrer: document.referrer || null,
      trafficSource: getQueryParam("utm_source") || getQueryParam("ref") || null,
      trafficMedium: getQueryParam("utm_medium") || null,
      trafficName: getQueryParam("utm_campaign") || null,
      gaId: getCookie("_ga") || null,
      firstVisitDate: getFirstVisitDate(),
      osDetectedDate: getOsDetectedDate()
    };
  }

  function mergeWithStoredData(storedData, newData) {
    // Create a merged object that preserves existing values
    // but updates with new values if they exist
    return {
      id: 1,
      pageUrl: newData.pageUrl, // Always update current page
      pagePath: newData.pagePath, // Always update current path
      osId: newData.osId || storedData.osId,
      userName: newData.userName || storedData.userName,
      referrer: newData.referrer || storedData.referrer,
      trafficSource: newData.trafficSource || storedData.trafficSource,
      trafficMedium: newData.trafficMedium || storedData.trafficMedium,
      trafficName: newData.trafficName || storedData.trafficName,
      gaId: newData.gaId || storedData.gaId,
      firstVisitDate: storedData.firstVisitDate || newData.firstVisitDate,
      osDetectedDate: storedData.osDetectedDate || newData.osDetectedDate,
      lastTracked: storedData.lastTracked || null, // When we last sent to Segment
      lastUpdated: new Date().toISOString()
    };
  }

  function hasRequiredTrackingData(data) {
    // Must have osId
    if (!data.osId) {
      console.log("‚ö†Ô∏è Missing osId, tracking requirements not met");
      return false;
    }
    
    // Must have at least one of: gaId or any UTM parameter
    const hasGaId = !!data.gaId;
    const hasUtmData = !!(data.trafficSource || data.trafficMedium || data.trafficName);
    
    if (!hasGaId && !hasUtmData) {
      console.log("‚ö†Ô∏è Missing gaId and UTM data, tracking requirements not met");
      return false;
    }
    
    console.log("‚úÖ Tracking requirements met: osId present with " + 
                (hasGaId ? "gaId" : "") + 
                (hasGaId && hasUtmData ? " and " : "") + 
                (hasUtmData ? "UTM data" : ""));
    return true;
  }

  function detectChanges(oldData, newData) {
    // We track changes in these key fields
    var keysToCheck = ["osId", "gaId", "trafficSource", "trafficMedium", "trafficName"];
    
    for (var i = 0; i < keysToCheck.length; i++) {
      var key = keysToCheck[i];
      // Only consider a change if the new value exists and is different
      if (newData[key] && newData[key] !== oldData[key]) {
        console.log(`üîç Change detected in ${key}: ${oldData[key]} -> ${newData[key]}`);
        return true;
      }
    }
    
    console.log("üîç No relevant changes detected");
    return false;
  }

  function sendToSegment(data, isNewData) {
    // Mark this data as tracked
    data.lastTracked = new Date().toISOString();
    
    // Update IndexedDB with the lastTracked timestamp
    saveToIndexedDB(data);
    
    if (window.analytics && typeof window.analytics.track === "function") {
      window.analytics.track("GTM IndexedDB Event", {
        osId: data.osId,
        pageUrl: data.pageUrl,
        pagePath: data.pagePath,
        userName: data.userName,
        referrer: data.referrer,
        trafficSource: data.trafficSource,
        trafficMedium: data.trafficMedium,
        trafficName: data.trafficName,
        gaId: data.gaId,
        firstVisitDate: data.firstVisitDate,
        osDetectedDate: data.osDetectedDate,
        eventTimestamp: new Date().toISOString(),
        isNewData: isNewData
      });
      console.log("‚úÖ Event sent to Segment:", data);
      return true;
    } else {
      console.error("‚ùå Segment analytics.js not loaded or not initialized");
      
      // Queue the event for later when analytics might be available
      queueEventForLater(data, isNewData);
      return false;
    }
  }

  function queueEventForLater(data, isNewData) {
    // Store the pending event in sessionStorage
    try {
      var pendingEvents = JSON.parse(sessionStorage.getItem('pendingSegmentEvents') || '[]');
      pendingEvents.push({
        data: data,
        isNewData: isNewData,
        timestamp: new Date().toISOString()
      });
      sessionStorage.setItem('pendingSegmentEvents', JSON.stringify(pendingEvents));
      console.log("‚è≥ Event queued for later sending");
      
      // Set up a timer to check if analytics becomes available
      if (!window._segmentRetryTimerSet) {
        window._segmentRetryTimerSet = true;
        var checkInterval = setInterval(function() {
          if (window.analytics && typeof window.analytics.track === "function") {
            processPendingEvents();
            clearInterval(checkInterval);
          }
        }, 2000); // Check every 2 seconds
      }
    } catch (e) {
      console.error("‚ùå Error queueing event:", e);
    }
  }

  function processPendingEvents() {
    try {
      var pendingEvents = JSON.parse(sessionStorage.getItem('pendingSegmentEvents') || '[]');
      if (pendingEvents.length > 0) {
        console.log(`‚è≥ Processing ${pendingEvents.length} pending events`);
        pendingEvents.forEach(function(eventObj) {
          sendToSegment(eventObj.data, eventObj.isNewData);
        });
        sessionStorage.removeItem('pendingSegmentEvents');
      }
    } catch (e) {
      console.error("‚ùå Error processing pending events:", e);
    }
  }

  function getQueryParam(param) {
    var params = new URLSearchParams(window.location.search);
    return params.has(param) ? params.get(param) : null;
  }

  function getCookie(name) {
    var match = document.cookie.match(new RegExp("(^| )" + name + "=([^;]+)"));
    return match ? match[2] : null;
  }

  function getFirstVisitDate() {
    try {
      var storedDate = localStorage.getItem("firstVisitDate");
      if (!storedDate) {
        storedDate = new Date().toISOString();
        localStorage.setItem("firstVisitDate", storedDate);
      }
      return storedDate;
    } catch (e) {
      console.warn("‚ö†Ô∏è LocalStorage access error:", e);
      return new Date().toISOString();
    }
  }

  function getOsDetectedDate() {
    try {
      var osId = getQueryParam("os");
      var storedOsId = localStorage.getItem("lastOsId");
      var storedDate = localStorage.getItem("osDetectedDate");

      if (osId && (!storedDate || osId !== storedOsId)) {
        storedDate = new Date().toISOString();
        localStorage.setItem("osDetectedDate", storedDate);
        localStorage.setItem("lastOsId", osId);
      }

      return storedDate || null;
    } catch (e) {
      console.warn("‚ö†Ô∏è LocalStorage access error:", e);
      return null;
    }
  }

  function processTracking() {
    console.log("üîÑ Starting Segment tracking process");
    
    getIndexedDBData()
      .then(storedData => {
        // Always collect new data from current page
        const newData = collectNewData();
        console.log("üîç New data collected:", newData);
        
        // Merge new data with stored data, preserving existing values
        const mergedData = mergeWithStoredData(storedData, newData);
        console.log("üîç Data after merging:", mergedData);
        
        // Always save merged data to IndexedDB for persistence
        return saveToIndexedDB(mergedData)
          .then(savedData => {
            // Check if we have the required data for tracking
            if (!hasRequiredTrackingData(savedData)) {
              console.log("‚ö†Ô∏è Skipping Segment tracking - missing required data");
              return null;
            }
            
            // Check if this is new data or if tracked values have changed
            const hasChanges = Object.keys(storedData).length === 0 || detectChanges(storedData, savedData);
            
            // Don't send to Segment if we've already tracked this data and nothing changed
            if (!hasChanges && storedData.lastTracked) {
              console.log("‚úÖ No changes detected since last tracked event. Skipping Segment tracking.");
              return null;
            }
            
            // Send to Segment
            console.log("üîÑ Tracking requirements met and changes detected, sending to Segment...");
            sendToSegment(savedData, Object.keys(storedData).length === 0);
            return savedData;
          });
      })
      .catch(error => {
        console.error("‚ùå Error in tracking process:", error);
      });
  }

  // Check if any events are pending from previous page loads
  if (window.analytics && typeof window.analytics.track === "function") {
    processPendingEvents();
  }

  // Start the tracking process
  processTracking();

  // Expose a global function to manually trigger tracking (useful for SPAs)
  window.refreshTracking = processTracking;
})();

